import React, { useEffect, useState } from 'react'
import './moviecard.css'

import movie1 from '../assets/movies/movie1.jpg'
import movie2 from '../assets/movies/movie2.jpg'
import movie3 from '../assets/movies/movie3.jpg'
import movie4 from '../assets/movies/movie4.jpg'
import movie6 from '../assets/movies/movie6.jpg'


function MoviesCard() {
  const [movies, setMovies] = useState('')

  const fetchdata = async () => {
    const url = 'http://localhost:8000/admin/getmovie'  
    const response = await fetch(url)
    .then((response) => response.json())
    .then((data) => setMovies(data.movies))
  }

  useEffect(() => {
    fetchdata()
  }, [])

  return (
    <div className='grid-movie'>
      {Array.isArray(movies)
        ? movies.map(element => {
            return (
              <div>
                <div className='box' style={{ backgroundImage: `url(http://localhost:8000/${movie1})` }}></div>
              </div>
            )
          })
        : null
        }
      
        <div className='box' style={{ backgroundImage: `url(${movie1})` }}></div>
        <div className='box' style={{ backgroundImage: `url(${movie2})` }} ></div>
        <div className='box'  style={{ backgroundImage: `url(${movie3})` }}></div>
        <div className='box'  style={{ backgroundImage: `url(${movie4})` }}></div>
        <div className='box' style={{ backgroundImage: `url(${movie6})` }}></div>
        <div className='box' style={{ backgroundImage: `url(${movie2})` }}></div>
    </div>
  )
}

export default MoviesCard
